import './App.css';
import {  BrowserRouter, Routes,Route} from 'react-router-dom'
import { Login } from './component/login';
import Home from './component/home';


function App(){
  return(
    <>
  <button>kasem</button>
    <BrowserRouter>
  <Routes>
    <Route path='/' element={<Login/>}/>
    <Route path='home' element={<Home/>}/>
  </Routes>
  </BrowserRouter>
  </>
  )

}

export default App;
